To find out how many pieces Poppy placed on the board as a quarter of it, we first need to divide the total number of pieces by four since one fourth means dividing something into four equal parts. Let's perform this calculation using JavaScript code snippet provided below:
```javascript
const total_pieces = 7462704;
let halfway_mark = Math.floor(total_pieces / 4); // Finds one quarter part which represents 'halfway mark'. It uses floor function because you can’t put partial piece onto the board.
console.log("Quarter amount of Pieces : ", halfway_mark);
// Output would be Quarter amount of Pieces :  1865676
```
So according to our calculation, if Poppy laid down about 1,865,676 pieces initially, representing one quarter or approximately 25% of the whole set.

